'use strict';
let stdlib = require('@gehtsoft/LuaxStdlib-node').stdlib;
//@@DocInclude
//@@DocBrief("The base monitoring events.")
class BaseEvent {
    name;
    eventDate;
    constructor() {
        this.name = "";
        this.eventDate = stdlib.mkdate(1900, 1, 1);
    }
    getName() {
        return this.name;
    }
    getDateTime() {
        return this.eventDate;
    }
}
module.exports = BaseEvent
